import React from "react";

const VintageHeader = () => {
  const vintageStyle = {
    width: "100%",
    height: "200px",
    background:
      "linear-gradient(to bottom, rgba(217, 192, 152, 0.3), rgba(128, 142, 73, 0.3) 25%, rgba(217, 192, 152, 0.3) 75%, rgba(217, 192, 152, 0.3))",
    position: "relative",
    borderTop: "3px solid rgba(217, 192, 152, 0.3)",
    borderBottom: "3px solid rgba(217, 192, 152, 0.3)",
    boxShadow: "0px 4px 6px rgba(0, 0, 0, 0.3)",
    backgroundSize: "cover",
    backgroundBlendMode: "multiply",
    backgroundClip: "padding-box",
    borderRadius: "4px",
    /* No opacity so content remains clear */
  };

  const pseudoBeforeAfter = {
    content: '""',
    display: "block",
    width: "100%",
    height: "20px",
    background:
      "linear-gradient(to bottom, rgba(217, 192, 152, 0.3), rgba(128, 142, 73, 0.3) 50%, rgba(217, 192, 152, 0.3))",
    position: "absolute",
  };

  return (
    <div style={vintageStyle}>
      <div style={{ ...pseudoBeforeAfter, top: 0 }}></div>
      <div style={{ ...pseudoBeforeAfter, bottom: 0 }}></div>
      <div style={{ zIndex: 1, position: "relative", color: "#000" }}>
        {/* Place your content here without opacity affecting it */}
        <h1>Foodie Page</h1>
      </div>
    </div>
  );
};

export default VintageHeader;
